import ReactDOM from 'react-dom';

import App from './App';
import Layout from './layout';
import Innerlayout from './innerlayout';


ReactDOM.render(
  <Layout>
    <Innerlayout></Innerlayout>
    <App />
  </Layout>,
  document.getElementById('root')
);
